import React from 'react';
import './ClothesPage.css';
import { FaSearch, FaShoppingCart, FaUser } from 'react-icons/fa';
import { useNavigate } from 'react-router-dom';

const ClothesPage = () => {
  const navigate = useNavigate();
  
  const products = [
    { id: 1, name: 'Name', price: '$15', description: 'Lorem ipsum dolor sit amet, consectetur adipiscing elit.', image: '/phone.jpg' },
    { id: 2, name: 'Name', price: '$15', description: 'Lorem ipsum dolor sit amet, consectetur adipiscing elit.', image: '/laptop.jpg' },
    { id: 3, name: 'Name', price: '$15', description: 'Lorem ipsum dolor sit amet, consectetur adipiscing elit.', image: '/bread.jpg' },
    { id: 4, name: 'Name', price: '$15', description: 'Lorem ipsum dolor sit amet, consectetur adipiscing elit.', image: '/controller.jpg' }
  ];

  return (
    <div className="clothes-page">
      <nav className="navbar">
        <div className="nav-left">
          <ul className="nav-links">
            <li><a href="#clothes">Clothes</a></li>
            <li><a href="#gadgets">Gadgets</a></li>
            <li><a href="#new">New</a></li>
            <li><a href="#featured">Featured</a></li>
            <li><a href="#barter">Barter</a></li>
          </ul>
        </div>

        <div className="nav-center">
          <h1>TECHSELL</h1>
        </div>

        <div className="nav-right">
          <button className="icon-button"><FaSearch /></button>
          <button className="icon-button"><FaShoppingCart /></button>
          <button className="icon-button" onClick={() => navigate('/')}><FaUser /></button>
        </div>
      </nav>

      <div className="top-deals">
        <h2>Top Deals</h2>
        <div className="products-grid">
          {products.map(product => (
            <div key={product.id} className="product-card">
              <img src={product.image} alt={product.name} />
              <h3>{product.name}</h3>
              <p>{product.description}</p>
              <span className="price">{product.price}</span>
            </div>
          ))}
        </div>
      </div>
    </div>
  );
};

export default ClothesPage;
